import React from "react";
import {Navbar} from "./Navbar";
import '../common/styles/home.css';


export const Home = () => {
  return (
    <body>
    <div className="home">    
      <Navbar/>    
      <img className="img-Background" src="img.jpg" alt=""></img>

    </div>
    </body>
  );
};
